import math
def ispowerfulnumber(n):
    while(n%2==0):
        power=0
        while(n%2==0):
            n=n//2
            power=power+1
        if(power==1):
            return False
    for f in range(3,int(math.sqrt(n))+1,2):
        power=0
        while(n%f==0):
            n=n//f
            power=power+1
        if(power==1):
            return False
    return (n == 1)                    
def nthpowerfulnumber(n):
    i=0
    j=0
    while(i<=n):
        j += 1
        if(ispowerfulnumber(j)):
            i +=1
    return    j
